<template>
  <div>
    <div>
      <ApplicationSwiperRSingleSwiper
        swiperContainerClass="md:w-[700px] w-full"
        :images="imageForMenu"
        :grabCursor="computedCenteredVal"
        :hasControllersBtn="false"
        :centeredSlides="computedCenteredVal"
        :init="computedCenteredVal"
        :breakPoints="{
          0: {
            slidesPerView: 1,
          },
          640: {
            slidesPerView: 3,
            spaceBetween: 20,
          },
          768: {
            slidesPerView: 4,
            spaceBetween: 40,
          },
          1024: {
            slidesPerView: 5,
            spaceBetween: 50,
          },
        }"
      >
        <template 
