        >
          <div :key="index" class="inline-flex items-center flex-col gap-2">
            <img class="w-[100px] h-[100px] object-cover rounded-full border-solid border-2 border-logoColor p-1" draggable="false" :src="objectValue.src" />
            <small class="text-sm font-light text-center font-['vazir']">
              {{ objectValue.alt }}
            </small>
          </div>
        </template>
      </ApplicationSwiperRSingleSwiper>
