<script lang="ts" setup>

// computed
const computedCenteredVal = computed(() => {
  if (window?.innerWidth) {
    windowW.value = window?.innerWidth
    console.log(windowW.value);
    if (windowW.value <= 600) {
      return true
    } else {
      return false
    }
  }
})
// data
const windowW = ref(0)
const imageForMenu = [
  {
    src:  "data:image/octet-stream;base64,",
    alt: "اخبار"
  },
  {
    src:  "data:image/octet-stream;base64,",
    alt: "آپارات"
  },
  {
    src:  "data:image/octet-stream;base64,",
    alt: "ترکیب خودت رو بساز"
  },
  {
    src:  "data:image/octet-stream;base64,",
    alt: "شعب"
  },
]

// listeners
onMounted(() => {
  window.addEventListener('resize', () => {
    windowW.value = window.innerWidth
  })
})
</script>

